/*Table structure for table `email` */

DROP TABLE IF EXISTS `email`;

CREATE TABLE `email` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `subject` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `from_email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `to_email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `sent_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `email` */

insert  into `email`(`id`,`name`,`subject`,`content`,`from_email`,`to_email`,`sent_date`) values (1,'aaaaa','asasasa','<p>aaaaaaaaaaaaaa</p>\n','ss','asas','0000-00-00');

/*Table structure for table `email_template` */

DROP TABLE IF EXISTS `email_template`;

CREATE TABLE `email_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `type` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `subject` varchar(5000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

/*Data for the table `email_template` */

insert  into `email_template`(`id`,`name`,`type`,`subject`,`content`) values (1,'SALE_ORDER_EMAIL','html','Đơn hàng Oishii','<p><span style=\"font-family:arial,helvetica,sans-serif\">Xin ch&agrave;o {{customer_name}},</span></p>\n\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><u><strong>Th&ocirc;ng tin kh&aacute;ch h&agrave;ng</strong>: </u></span></p>\n\n<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\" style=\"width:600px\">\n	<tbody>\n		<tr>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Th&ocirc;ng tin người mua</strong></span></td>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Th&ocirc;ng tin người nhận</strong></span></td>\n		</tr>\n		<tr>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Họ t&ecirc;n: {{customer_name}}</span></td>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Họ t&ecirc;n: {{receiver_name}}</span></td>\n		</tr>\n		<tr>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Email: {{customer_email}}</span></td>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Email: {{receiver_email}}</span></td>\n		</tr>\n		<tr>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Điện thoại: {{customer_phone}}</span></td>\n			<td><span style=\"font-family:arial,helvetica,sans-serif\">Điện thoại: {{receiver_phone}}</span></td>\n		</tr>\n		<tr>\n			<td>\n			<p><span style=\"font-family:arial,helvetica,sans-serif\">Đia chỉ:</span></p>\n\n			<p><span style=\"font-family:arial,helvetica,sans-serif\">{{customer_address}}</span></p>\n			</td>\n			<td>\n			<p><span style=\"font-family:arial,helvetica,sans-serif\">Đia chỉ:</span></p>\n			<span style=\"font-family:arial,helvetica,sans-serif\">{{receiver_address}}</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><u><strong>Th&ocirc;ng tin đơn h&agrave;ng</strong>:</u> <strong>{{code}}</strong></span></p>\n\n<table border=\"1\" cellpadding